public class CustomModelMapper {
     private final ModelMapper modelMapper;

     public CustomModelMapper(ModelMapper modelMapper) {
         this.modelMapper = modelMapper;
     }

     public static  D convert(Object source, Class classLiteral) {
         return modelMapper.map(source, classLiteral);
     }

     public static  List convert(Collection sourceList, Class classLiteral) {
         return sourceList.stream()
                 .map(source -> modelMapper.map(source, classLiteral))
                 .collect(Collectors.toList());
     }

     public static  Page convert(Page sourceList, Class classLiteral, Pageable pageable) {
         List list = sourceList.getContent().stream()
                 .map(source -> modelMapper.map(source, classLiteral))
                 .collect(Collectors.toList());
         return new PageImpl<>(list, pageable, sourceList.getTotalElements());
     }
 }



