    @Configuration
    @Order(1)
    @ComponentScan(basePackages = {
            "kr.co.apexsoft.web.crowd.service"})
    public static class UserSecurityConfigurationAdapter extends WebSecurityConfigurerAdapter {

        @Autowired
        private UserService userService;

        @Override
        protected void configure(HttpSecurity http) throws Exception {
            http
                    .csrf()

                    .and()
                    .formLogin()
                    .loginPage("/user/signin")
                    .loginProcessingUrl("/user/auth/login")
                    .usernameParameter("userId")
                    .passwordParameter("password")
                    .successHandler(loginSuccessHandler())
                    .failureHandler(loginFailureHandler())
                    .permitAll()
                    .and()
                    .logout()
                    .logoutRequestMatcher(new AntPathRequestMatcher("/user/auth/logout"))
                    .logoutSuccessHandler(logoutSuccessHandler())
                    .permitAll()
                    .and().

                sessionManagement()
                    .maximumSessions(1)
                    .maxSessionsPreventsLogin(true)
                    .sessionRegistry(sessionRegistry());

        }

        @Bean
        public SessionRegistry sessionRegistry() {
            return new SessionRegistryImpl();
        }

        @Bean
        public static ServletListenerRegistrationBean httpSessionEventPublisher() {
            return new ServletListenerRegistrationBean(new HttpSessionEventPublisher());
        }

        public RestLoginSuccessHandler loginSuccessHandler() {
            return new RestLoginSuccessHandler();
        }

        public RestLoginFailureHandler loginFailureHandler() {
            return new RestLoginFailureHandler(userService);
        }

        public RestLogoutSuccessHandler logoutSuccessHandler() {
            return new RestLogoutSuccessHandler();
        }
    }



    }

}


public class RestLoginFailureHandler implements AuthenticationFailureHandler {
    Logger logger = LoggerFactory.getLogger(RestLoginFailureHandler.class);

    private UserService userService;

    public RestLoginFailureHandler(UserService userService) {
        this.userService = userService;
    }

    @Override
    public void onAuthenticationFailure(HttpServletRequest request, HttpServletResponse response,
                                        AuthenticationException exception) throws IOException, ServletException {
        String userId = request.getParameter("userId");

        ErrorResponse errorResponse = new ErrorResponse();

        if (exception instanceof LockedException) {//계정 잠김
            request.setAttribute("userId", userId);
            request.getRequestDispatcher("/user/recaptcha").forward(request, response);
            return;
        } else if (exception instanceof UsernameNotFoundException) {//계정 없음
            errorResponse.setMessage("계정 없음");
        } else if (exception instanceof BadCredentialsException) {//비밀번호 불일치
            errorResponse.setMessage("비밀번호 불일치");
        } else if (exception instanceof DisabledException) {//계정 disable
            errorResponse.setMessage("이메일인증이 되지 않았거나, 탈퇴한 회원입니다. 인증메일 추가발송은 메일로 문의해주세요.");
        } else if (exception instanceof AccountExpiredException) {//계정 만료
            errorResponse.setMessage("계정 만료");
        } else if (exception instanceof CredentialsExpiredException) {//계정 권한 만료
            errorResponse.setMessage("계정 권한 만료");
        } else if (exception instanceof SessionAuthenticationException) {//계정 권한 만료
            errorResponse.setMessage("중복 로그인");
        } else {//그외 서버 에러
            errorResponse.setMessage("서버 에러");
        }
        logger.debug("로그인 실패");
        request.setAttribute("errorResponse", errorResponse);
        request.getRequestDispatcher("/user/signin?error=true").forward(request, response);
    }
}

docs/SpringBoot/전송 어노테이션.html.body:
REST API 전송
파라미터 앞에 @ModelAttribute와 @RequestBody를  사용했는데, 바인딩이 안되는 경우 에러를 찾지 못하는 경우 

Client에서 Server로 Ajax call을 날렸다. 분명히 날렸음에도 인자값은 전달되지않고 Null Pointer Exception을 발생시켜버린다. 이유가 무엇일까?

GET/POST 등은 각각의 다른 방식으로 데이터를 서버로 전송한다.
GET

URL에 데이터를 담아 전송하며 1차원 데이터밖에 담지 못한다(2차원 배열, 객체속 객체 등등은 불가능하다.)
따라서 검색조건 수준의 데이터를 담는게 옳바르다



POST

Request 의 Body에 데이터를 담는데 이 경우 JSON, 다차원 데이터를 담을 수 있다.

EX) 컨트롤러를 작성할 때 GET방식 메서드의 파라미터 앞에 @RequestBody 어노테이션을 붙혔다. 그럼 데이터 바인딩이 가능할까?


"GET 방식 프로토콜은 Request 패킷에 Body가 존재하지 않는다. 따라서 데이터를 가져올 수 없다. "




EX)당연히 자동으로 바인딩해주는 줄 알고 파라미터에 @RequestBody 어노테이션을 쓰지 않았다. 하지만 테스트를 해보니 'java.lang.NullPointerException'가 개발자를 반겼다. 어디서부터 문제인가?


"@RequestBody 어노테이션으로 명시해주지 않은 파라미터는 GET방식으로 데이터를 바인딩 시키기 때문에 결과적으로 NULL이 들어간다. 
POST방식은 Body에 데이터가 들어가 있기 때문이다."





결론 : @RequestBody는  POST방식일때
@RequstBody

http 본문자체를 읽는 부분을 모델로 변환시켜주는 어노테이션이다. 
Rest API 만들때는 자주 사용하는 어노테이션이다.


JSON 이나 XML같은 데이터를 적절한 messageConverter로 읽을때 사용하거나, POJO형태의 데이터 전체로 받을경우에 사용된다.
Content-Type이 application/json  이거나 XML 


페이지에서 FORM에 들어가는 객체를 Submit으로 전송할 때는 @RequestBody 형태로 넘어가지 않는다. 
HTML 기반의 컨텐츠 타입에서 데이터를 Submit할 때는 Content-Type이 application/x-www-form-urlencoded 방식으로 넘어가기 때문이다. 
이 때 객체를 넘겨 받는 커텐츠의 Content-Type의 형태는 application/x-www-form-urlencoded 나 multipart/form-data 의 형태가 되어야한다.




반드시 POST형식으로 응답을 받는 구조여야만 한다. 


@ModelAttribute

기존에는 post방식으로 전송하면 파라미터를 객체와 맵핑 하였다 
이전에는 api서비스가 많지 않았고 , 대부분 웹에서 form을 사용하여 submit을 하였기 때문에 


POST로 넘어오는 객체 파라미터를 @ModelAttribute에 매핑하기 위해서는
HTTP Request의 컨텐트타입이 application/x-www-form-urlencoded 이나 multipart/form-data 이어야만 한다.
application/x-www-form-urlencoded와 multipart/form-data의 차이는 POST를 전송할 때 MultipartFile 파일을 함께 전송하는지에 따라 차이가 난다.




http 요청 파라미터를 VO로 받는다 (커맨드 객체라고도 한다.)
도메인이나 오브젝트로 파라미터를 받을 경우는 @ModelAttribute으로 받을수 있다.
@RequestParam과 비슷한데 1:1로 파라미터를 받을경우는 @RequestParam를 사용하고, 


검증(Validation)작업을 추가로 할수 있는데 예로들어 null이라던지, 각 멤버변수마다 valid옵션을 줄수가 있고 여기서 에러가 날 경우 BindException 이 발생한다.
@ModelAttribute 어노테이션은 Parameter에 쓸 경우 받아오고자하는 데이터의 이름을 지정하여 해당 데이터만을 가져온다. 
EX) { name : 'master', comment : '모두가 master가 되는 그날 까지 ' }이라고 ajax-data에 넣었다고 치고, 컨트롤러에 @ModelAttribute('comment') String comment 라고 하면 comment속엔 '모두가 master가 되는 그날 까지'만을 받아온다. 
결론 : @ModelAttribute는 받아오는 데이터를 '지정'한다.



