3.한 개 컬럼에 매핑 - @Converter
밸류타입을 한개 컬럼에 저장해야 할 때 방법이다. 
Example
EmailSet
public class EmailSet {  
 private Set emails = new HashSet<>();  

 private EmailSet() {}  
 private EmailSet(Set emails) {  
 this.emails.addAll(emails);  
 }  

 public Set getEmails() {  
 return Collections.unmodifiableSet(emails);  
 }  
}

엔터티 내부
@Column(name = "emails")  
@Convert(converter = EmailSetConverter.class)  
private EmailSet emailSet;

EmailSetConverter
@Converter
public class EmailSetConverter implements AttributeConverter {
    @Override
    public String convertToDatabaseColumn(EmailSet attribute) {
        if (attribute == null) return null;
        return attribute.getEmails().stream()
                .map(Email::toString)
                .collect(Collectors.joining(","));
    }

    @Override
    public EmailSet convertToEntityAtrribute(String dbData) {
        if (dbData == null) return null;
        String[] emails = dbData.split(",");
        Set emailSet = Arrays.stream(emails)
                .map(value -> new Email(value))
                .collec(toSet());
        return new EmailSet(emailSet);
    }
}


emails 한 컬럼에 콤마로 구분된 데이터들이 들어간다. (test@d.com, test@t.com)
콤마로 구분된 데이터들을 객체에서 컬렉션으로 변환된다.

