docs/DDD/JpaAuditor.html.body:
Jpa Auditing

jpa 사용시 중복으로 사용 되는부분 id 생성시간 등을  Auditing Entity를 통해 중복을 제거하고 자동화 시킨다


Auditing Entity

@EntityListeners(AuditingEntityListener.class)
@MappedSuperclass
@Getter
@JsonInclude(JsonInclude.Include.NON_NULL)
public abstract class AbstractBaseEntity implements Serializable {

    @CreatedDate
    @Column(name = "CREATED_DATE", updatable = false)
    protected LocalDateTime createdDateTime;

    @JsonFormat(pattern="yyyy-MM-dd HH:mm")
    @LastModifiedDate
    @Column(name = "LAST_MODIFIED_DATE", updatable = true)
    protected LocalDateTime lastModifiedDateTime;

    @JsonIgnore
    @Column(name = "CREATED_BY", updatable = false)
    @CreatedBy
    protected String createdBy;

    @JsonIgnore
    @Column(name = "LAST_MODIFIED_BY", updatable = true)
    @LastModifiedBy
    protected String lastModifiedBy;
}




EnableJpaAuditing


createDate와 modifiedDate에 대해서만 자동
@EnableJpaAuditing
@Configuration
public class JpaAuditingConfig {

}


createdBy나 lastModifiedBy도 자동
@Configuration
@EnableJpaAuditing(auditorAwareRef="auditorProvider")
public class PersistenceConfig {

    @Bean
    AuditorAware auditorProvider() {
        return new AuditorAware() {
            @Override
            public Optional getCurrentAuditor() {
                return Optional.ofNullable(SecurityContextHolder.getContext())
                        .map(SecurityContext::getAuthentication)
                        .filter(Authentication::isAuthenticated)
                        .map(Authentication::getPrincipal)
                        .map(principal -> {
                            if (principal instanceof String)
                                return (String) principal;
                            if (principal instanceof UserPrincipal)
                                return ((UserPrincipal) principal).getUsername();
                            return "INVALID-USER";
                        });
            }
        };
    }
}

